CREATE VIEW [dbo].[GetDataSetNguoiDung]
AS
SELECT        dbo.ANguoiDung.MaNguoiDung AS Expr1, dbo.ANguoiDung.MaNhomNguoiDung AS Expr2, dbo.ANguoiDung.MatKhau AS Expr3, dbo.ANguoiDung.TaiKhoan AS Expr4, 
                         dbo.ANguoiDung.MoTa AS Expr5, dbo.ANguoiDung.Active AS Expr6, dbo.ANguoiDung.MaNhanVien AS Expr7, dbo.ANguoiDung.*, 
                         dbo.ANhomNguoiDung.MaNhomNguoiDung AS Expr8
FROM            dbo.ANguoiDung INNER JOIN
                         dbo.ANhomNguoiDung ON dbo.ANguoiDung.MaNhomNguoiDung = dbo.ANhomNguoiDung.MaNhomNguoiDung

