CREATE VIEW [dbo].[phanQuyen]
AS
SELECT        dbo.AMenu.TenMenu, dbo.ANhomMenu.[VIEW], dbo.ANhomMenu.[ADD], dbo.ANhomMenu.EDIT, dbo.ANhomMenu.[DELETE], dbo.ANhomMenu.IMPORT, 
                         dbo.ANhomMenu.EXPORT, dbo.ANhomMenu.[PRINT], dbo.ANhomMenu.CONTROL, dbo.ANguoiDung.TaiKhoan
FROM            dbo.ANhomMenu INNER JOIN
                         dbo.AMenu ON dbo.ANhomMenu.MaMenu = dbo.AMenu.MaMenu INNER JOIN
                         dbo.ANhomNguoiDung ON dbo.ANhomMenu.MaNhomNguoiDung = dbo.ANhomNguoiDung.MaNhomNguoiDung INNER JOIN
                         dbo.ANguoiDung ON dbo.ANhomNguoiDung.MaNhomNguoiDung = dbo.ANguoiDung.MaNhomNguoiDung

