-- =============================================
-- Author:		Phuoc Nguyen
-- Create date: 2013-04-02
-- Description:	Get all customer and product
-- =============================================
CREATE PROCEDURE [dbo].[GetCustomerProduct]
	-- Add the parameters for the stored procedure here
	@StartDate datetime, 
	@EndDate datetime
AS
BEGIN
	-- SET NOCOUNT ON added to prevent extra result sets from
	-- interfering with SELECT statements.
	SET NOCOUNT ON;
	IF( @StartDate IS NULL OR @EndDate IS NULL) BEGIN
				select c.customer_id as CustomerID,c.email as Email,c.lastname as LastName,c.firstname as FirstName,c.sex as Gender,c.birthday as Birthday,c.homephone as HomePhone,c.mobilephone as MobilePhone,c.address as Address,d.name as District,ci.name as City,c.identitycard as IdCard,j.name as Job, e.name as Education ,c.datereg as RegistrationDate,ct.name as Channel ,c.status_active as TrangThai,cat.name as Category,p.name as ModelName,o.serial as Serial,s.name as Shop, o.regdate as ProductRegDate
		from customer c
		inner join orders o on o.customer_id = c.customer_id
		inner join products p on p.product_id = o.product_id
		inner join categories cat on cat.category_id = p.category_id
		left join districts d on d.district_id = c.district_id
		left join cities ci on ci.city_id = c.city_id
		left join shops s on s.shop_id = o.shop_id
		left join jobs j on j.job_id = c.job_id
		left join education e on e.education_id = c.education_id		
		inner join customertype ct on ct.customertype_id = c.customertype_id
		where o.status_id = 1
		order by c.datereg
	END
	ELSE
		select c.customer_id as CustomerID,c.email as Email,c.lastname as LastName,c.firstname as FirstName,c.sex as Gender,c.birthday as Birthday,c.homephone as HomePhone,c.mobilephone as MobilePhone,c.address as Address,d.name as District,ci.name as City,c.identitycard as IdCard,j.name as Job, e.name as Education ,c.datereg as RegistrationDate,ct.name as Channel ,c.status_active as TrangThai,cat.name as Category,p.name as ModelName,o.serial as Serial,s.name as Shop, o.regdate as ProductRegDate
		from customer c
		inner join orders o on o.customer_id = c.customer_id
		inner join products p on p.product_id = o.product_id
		inner join categories cat on cat.category_id = p.category_id
		left join districts d on d.district_id = c.district_id
		left join cities ci on ci.city_id = c.city_id
		left join shops s on s.shop_id = o.shop_id
		left join jobs j on j.job_id = c.job_id
		left join education e on e.education_id = c.education_id
		inner join customertype ct on ct.customertype_id = c.customertype_id
		WHERE c.datereg >= @StartDate and c.datereg <= @EndDate and o.status_id = 1
		order by c.datereg
END

GO
/****** Object:  StoredProcedure [dbo].[GetCustomerShop]    Script Date: 2015/09/18 16:40:11 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
-- =============================================
-- Author:		<Phuoc Minh Nguyen>
-- Create date: <2014-08-07>
-- Description:	<Get disctint customer with the first shop they purchase>
-- =============================================
CREATE PROCEDURE [dbo].[GetCustomerShop]
	-- Add the parameters for the stored procedure here
	@StartDate datetime, 
	@EndDate datetime
AS
BEGIN
	-- SET NOCOUNT ON added to prevent extra result sets from
	-- interfering with SELECT statements.
	SET NOCOUNT ON;
	IF( @StartDate IS NULL OR @EndDate IS NULL) BEGIN
		WITH order_partition AS (
		SELECT o.order_id, 
			   o.customer_id, 
			   o.shop_id,
			   o.status_id,
			   ROW_NUMBER() OVER(PARTITION BY o.customer_id 
									 ORDER BY o.order_id) AS rk
		  FROM ORDERS o)
	      
	SELECT c.customer_id ,c.email as Email ,c.lastname as LastName,c.firstname as FirstName,c.sex as Gender,c.birthday as Birthday,c.homephone as HomePhone,c.mobilephone as MobilePhone,c.address as Address,d.name as District,ci.name as City,c.identitycard as IdCard,j.name as Job, e.name as Education ,c.datereg as RegistrationDate,ct.name as Channel ,c.status_active as TrangThai,s.name as Shop
	FROM order_partition op
	inner join customer c on c.customer_id = op.customer_id
	left join districts d on d.district_id = c.district_id
	left join cities ci on ci.city_id = c.city_id
	left join shops s on s.shop_id = op.shop_id
	left join jobs j on j.job_id = c.job_id
	left join education e on e.education_id = c.education_id		
	inner join customertype ct on ct.customertype_id = c.customertype_id
	WHERE op.rk = 1 and op.status_id = 1
	order by c.datereg
	
	END
	ELSE		
		WITH order_partition AS (
		SELECT o.order_id, 
			   o.customer_id, 
			   o.shop_id,
			   o.status_id,
			   ROW_NUMBER() OVER(PARTITION BY o.customer_id 
									 ORDER BY o.order_id) AS rk
		  FROM ORDERS o)
		      
		SELECT c.customer_id ,c.email as Email ,c.lastname as LastName,c.firstname as FirstName,c.sex as Gender,c.birthday as Birthday,c.homephone as HomePhone,c.mobilephone as MobilePhone,c.address as Address,d.name as District,ci.name as City,c.identitycard as IdCard,j.name as Job, e.name as Education ,c.datereg as RegistrationDate,ct.name as Channel ,c.status_active as TrangThai,s.name as Shop
		FROM order_partition op
		inner join customer c on c.customer_id = op.customer_id
		left join districts d on d.district_id = c.district_id
		left join cities ci on ci.city_id = c.city_id
		left join shops s on s.shop_id = op.shop_id
		left join jobs j on j.job_id = c.job_id
		left join education e on e.education_id = c.education_id		
		inner join customertype ct on ct.customertype_id = c.customertype_id
		WHERE op.rk = 1 and op.status_id = 1 and c.datereg >= @StartDate and c.datereg <= @EndDate
		order by c.datereg
END

