/****** Object:  StoredProcedure [dbo].[GetSerial]    Script Date: 2015/09/18 16:40:11 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
-- =============================================
-- Author:		Son NX
-- Create date: 2014-12-01
-- Description:	Get all Seril with customer
-- =============================================
create PROCEDURE [dbo].[GetSerial]
	 
AS
BEGIN
	 
	SET NOCOUNT ON;	
	 
	 CREATE TABLE #TMB(	 	
		category_id  INT  , 
		name   NVARCHAR(200)				
	 );
	 
	 INSERT INTO  #TMB
	 SELECT 		
		category_id ,
		name
	 FROM  products
	 GROUP BY category_id ,NAME 
	
	 
	SELECT  
		serial.serialnumber, 
		serial.status_id	,
		serial.serial_id,
		serial.modelname,
		serial.productcode  ,
		serial.manufacturingdate  ,
		serial.batterynumber,
		serial.adapternumber,
		serial.alphalenumber,
		serial.period,
		serial.expireddate,
		serial.dateimport,
		categories.category_id,
		ISNULL(categories.name , '') AS categoryname,		
		ISNULL(#TMB.name ,'') AS name ,
		customer.customer_id  , 
		ISNULl(customer.lastname , '') +SPACE(1)+ ISNULL(customer.firstname , '') as fullname
	FROM serial 
		LEFT JOIN  #TMB  ON serial.modelname  = #TMB.name	
		LEFT JOIN  categories  ON  #TMB.category_id   =   categories.category_id
		LEFT JOIN orders  ON serial.serialnumber  = orders.serial
		LEFT JOIN customer  ON  orders.customer_id   = customer.customer_id
		order by serial.dateimport desc
 

END

GO
/****** Object:  StoredProcedure [dbo].[ProductReportByMonthCenter]    Script Date: 2015/09/18 16:40:11 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
-- =============================================
-- Author:		<Phuoc Minh Nguyen>
-- Create date: <2014-05-06,>
-- Description:	<Get product based on month, sony center>
-- =============================================
CREATE PROCEDURE [dbo].[ProductReportByMonthCenter]
	-- Add the parameters for the stored procedure here
	@year int
AS
BEGIN
	-- SET NOCOUNT ON added to prevent extra result sets from
	-- interfering with SELECT statements.
	SET NOCOUNT ON;

   DECLARE @YearSonyCenter TABLE
	(
		RowId int IDENTITY(1,1),
		ShopId int,
		ShopName nvarchar(100) ,
		January int ,
		February int ,
		March int ,	
		April int  ,
		May int ,
		June int ,
		July int ,
		August int ,
		September int ,
		October int ,
		November int ,
		December int ,		
		Total INT 	
	)
	
	INSERT INTO @YearSonyCenter(
	ShopId,
	ShopName
	) 
	SELECT shop_id, name FROM shops
	WHERE shoptype_id = 1 AND status_id = 1 AND shop_id != 2
	
	
	DECLARE @Count int,
			@RowId int,
			@Month int,
			@ShopId bigint,
			@Value INT,
			@MonthMax INT,
			@ValueTotal INT
			
	SELECT @Count = MAX(RowId) FROM @YearSonyCenter
	SELECT @RowId = 1
	
	
	IF(@Count > 0) BEGIN
		--April to December
		WHILE(@RowId <= @Count) BEGIN			
			SET @MonthMax = 12
			SET @Month = 1
			SET @Year = @Year
			
			SELECT @ShopId = ShopId FROM @YearSonyCenter
			WHERE RowId = @RowId
			
			WHILE(@Month <= @MonthMax) BEGIN	
		
				SELECT @Value = dbo.GetRegisteredProductByMonth(@ShopId,@Month,@year)
				
				IF(@Month = 1) BEGIN 
					UPDATE @YearSonyCenter 
					SET January = @Value
					WHERE ShopId = @ShopId
				END
				ELSE IF (@Month = 2) BEGIN
					UPDATE @YearSonyCenter 
					SET February = @Value
					WHERE ShopId = @ShopId
				END
				ELSE IF (@Month = 3) BEGIN
					UPDATE @YearSonyCenter 
					SET March = @Value
					WHERE ShopId = @ShopId
				END
				ELSE IF (@Month = 4) BEGIN
					UPDATE @YearSonyCenter 
					SET April = @Value
					WHERE ShopId = @ShopId
				END
				ELSE IF (@Month = 5) BEGIN
					UPDATE @YearSonyCenter 
					SET May = @Value
					WHERE ShopId = @ShopId
				END
				ELSE IF (@Month = 6) BEGIN
					UPDATE @YearSonyCenter 
					SET June = @Value
					WHERE ShopId = @ShopId
				END
				ELSE IF (@Month = 7) BEGIN
					UPDATE @YearSonyCenter 
					SET July = @Value
					WHERE ShopId = @ShopId
				END
				ELSE IF (@Month = 8) BEGIN
					UPDATE @YearSonyCenter 
					SET August = @Value
					WHERE ShopId = @ShopId
				END
				ELSE IF (@Month = 9) BEGIN
					UPDATE @YearSonyCenter 
					SET September = @Value
					WHERE ShopId = @ShopId
				END
				ELSE IF (@Month = 10) BEGIN
					UPDATE @YearSonyCenter 
					SET October = @Value
					WHERE ShopId = @ShopId
				END
				ELSE IF (@Month = 11) BEGIN
					UPDATE @YearSonyCenter 
					SET November = @Value
					WHERE ShopId = @ShopId
				END
				ELSE IF (@Month = 12) BEGIN
					UPDATE @YearSonyCenter 
					SET December = @Value
					WHERE ShopId = @ShopId
				END	
				--new year -- January to March					
				
				
				SET @Month = @Month + 1							
			END
			--jump to next row
			SET @RowId = @RowId + 1			
		END
	END
	SELECT * FROM @YearSonyCenter
	
END

