/****** Object:  StoredProcedure [dbo].[UpdateOrderIdOnSerial]    Script Date: 2015/09/18 16:40:11 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
-- =============================================
-- Author:		<Phuoc Minh Nguyen>
-- Create date: <2013-05-15>
-- Description:	<update orderID on serial table if registered>
-- =============================================
CREATE PROCEDURE [dbo].[UpdateOrderIdOnSerial] 
	@StartDate datetime, 
	@EndDate datetime
AS
BEGIN
	-- SET NOCOUNT ON added to prevent extra result sets from
	-- interfering with SELECT statements.
	SET NOCOUNT ON;

    -- Insert statements for procedure here
	DECLARE @Order TABLE
	(
		RowId int IDENTITY(1,1),
		order_id INT,
		modelName NVARCHAR(100),
		serial NVARCHAR(100)
	)
	
	
	--get order list
	INSERT INTO @Order(
		order_id,
		modelName,
		serial		
	) 
	SELECT o.order_id,p.name,o.serial FROM orders o
	Inner join products p on p.product_id = o.product_id
	where modifieddate >= @StartDate and modifieddate <= @EndDate
	
	DECLARE @Count int,
			@RowId int,	
			@Serial nvarchar(100),
			@modelName nvarchar(100),
			@orderId int						
	
	SELECT @Count = MAX(RowId) FROM @Order
	SELECT @RowId = 1
	
	IF(@Count > 0) BEGIN
		WHILE(@RowId <= @Count) BEGIN	
			SELECT @orderId = order_id, @modelName = modelName, @Serial = serial FROM @Order
			WHERE RowId = @RowId		
			
			UPDATE serial
			SET RM2 = @orderId
			WHERE modelname = @modelName and serialnumber  = @Serial
			
			--jump to next row
			SET @RowId = @RowId + 1
			
		END	
	END

END

