create
 PROCEDURE [dbo].[ZGetDataSetNhomMenu]
	@MaNhomNguoiDung varchar(3)
AS

SELECT   rOW_NUMBER() over (order BY am.NhomMenuID) as 'STT',a.MaMenu,a.TenMenu,am.MaNhomNguoiDung,am.[VIEW],am.[ADD],am.EDIT,
am.[DELETE],am.IMPORT,am.EXPORT,am.[PRINT]


FROM  dbo.ANhomMenu am
INNER JOIN AMenu a ON am.MaMenu = a.MaMenu
WHERE am.MaNhomNguoiDung = @MaNhomNguoiDung

GO
